```solidity
pragma solidity ^0.6.12;

contract MyContract {
    address public owner;
    uint256 private totalSupply;
    mapping (address => uint256) public balanceOf;
    mapping (address => mapping (address => uint256)) public allowance;
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 public buyprice;
    uint256 public totalsupply;
    mapping (address => bool) public frozenaccount;

    constructor() public payable {
        owner = msg.sender;
        decimals = 18;
        totalsupply = 0x4b45ffe282d8783b000000;
        if (msg.value == 0) {
            balanceOf[msg.sender] = totalsupply;
        }
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        require(_spender != address(0));
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function withdrawEther() public {
        require(msg.sender == owner && address(this).balance >= 0x56bc75e2d63100000);
        msg.sender.transfer(address(this).balance);
    }

    function burn(uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value);
        balanceOf[msg.sender] -= _value;
        totalSupply -= _value;
        return true;
    }

    function setBuyPrice(uint256 _price) public returns (bool success) {
        require(msg.sender == owner && _price > 0);
        buyprice = _price;
        return true;
    }

    function freezeAccount(address _target, bool _freeze) public {
        require(msg.sender == owner);
        frozenaccount[_target] = _freeze;
    }

    function burnFrom(address _from, uint256 _value) public returns (bool success) {
        require(balanceOf[_from] >= _value && _value <= allowance[_from][msg.sender]);
        balanceOf[_from] -= _value;
        allowance[_from][msg.sender] -= _value;
        totalSupply -= _value;
        return true;
    }

    // This is the fallback function
    fallback() external payable {
        require(!frozenaccount[msg.sender] && balanceOf[owner] > msg.value * buyprice && msg.value > 0);
        balanceOf[owner] -= msg.value * buyprice;
        balanceOf[msg.sender] += msg.value * buyprice;
    }

    function transferOwnership(address newOwner) public {
        require(newOwner != owner && msg.sender == owner && newOwner != address(0));
        owner = newOwner;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= allowance[_from][msg.sender] && !frozenaccount[_from]);
        allowance[_from][msg.sender] -= _value;
        if (!frozenaccount[msg.sender] && _to != address(0) && balanceOf[_from] > _value && balanceOf[_to] + _value > balanceOf[_to]) {
            balanceOf[_from] -= _value;
            balanceOf[_to] += _value;
        }
        return true;
    }

    function approveAndCall(address _spender, uint256 _value, bytes memory _extraData) public returns (bool success) {
        require(_spender != address(0));
        allowance[msg.sender][_spender] = _value;
        if (_extraData.length > 0) {
            (bool success,) = _spender.call(abi.encodeWithSignature("receiveApproval(address,uint256,address,bytes)", msg.sender, _value, this, _extraData));
            require(success);
        }
        return true;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(!frozenaccount[msg.sender] && balanceOf[_to] + _value > balanceOf[_to] && balanceOf[msg.sender] > _value && _to != address(0));
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        return true;
    }

    function buy() public payable returns (bool success) {
        require(!frozenaccount[msg.sender] && balanceOf[owner] > msg.value * buyprice && msg.value > 0);
        balanceOf[owner] -= msg.value * buyprice;
        balanceOf[msg.sender] += msg.value * buyprice;
        return true;
    }
}
```

Note: This contract assumes that all calculations are performed with safe math operations to prevent overflow and underflow errors. Also, keep in mind that this contract lacks events and may not be fully compliant with the ERC20 standard. It is a simplified example based on the provided description, and should not be used in a production environment without further modifications and testing.
